INSERT INTO `facility` VALUES (1,1,'물품보관함','어드벤쳐 지하 1층 언더랜드','물품보관함에 물건을 맡기고 보다 편하게 파크를 즐기세요','이용요금 2000원','https://adventure.lotteworld.com/common/images/icon/guideArea2_icon11.png'),(2,1,'미아보호소','어드벤쳐 1층','아이를 잃어버리신 경우 찾아드리거나 보호하고 있으니 미아보호소를 방문해 주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon8.png'),(3,1,'분실물센터','어드벤쳐 1층','잃어버린 물건이 있으시다면 분실물 센터를 찾아주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon10.png'),(4,1,'의무실','어드벤쳐 1층','몸이 아프시거나 이상이 있어 도움이 필요하시다면 의무실을 방문해 주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon5.png'),(5,1,'유모차대여소','어드벤쳐 1층 손님상담실','가족 손님께 파크 내에서 사용 가능한 유모차를 대여해 드리고 있습니다',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon3.png'),(6,1,'현금지급기','어드벤쳐 1층','현금이 필요하시다면 가까운 현금지급기를 이용해주세요',NULL,'	https://adventure.lotteworld.com/common/images/icon/guideArea2_icon9_on.png'),(7,2,'물품보관함','파크곳곳','물품보관함에 물건을 맡기고 보다 편하게 파크를 즐기세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon11.png'),(8,2,'미아보호소','손님상담실/알파인매표소','아이를 잃어버리신 경우 찾아드리거나 보호하고 있으니 미아보호소를 방문해 주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon8.png'),(9,2,'분실물센터','손님상담실/알파인매표소','잃어버린 물건이 있으시다면 분실물 센터를 찾아주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon10.png'),(10,2,'의무실','정문/알파인 의무실','몸이 아프시거나 이상이 있어 도움이 필요하시다면 의무실을 방문해 주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon5.png'),(11,2,'자동제세동기','파크곳곳 ','응급상황 시 이용하세요',NULL,'https://e7.pngegg.com/pngimages/445/82/png-clipart-heart-automated-external-defibrillators-computer-icons-defibrillation-heart-love-child.png'),(12,2,'유모차대여소','스카이크루즈 상단 맞은편','유모차가 필요할 때 찾아주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon3.png'),(55,3,'고객 서비스','파크 입구','파크에 대해 궁금하시다면 찾아주세요. 파크 안내와 함께 미아보호, 분실물 접수 및 수령, 히어로패스 발급을 도움드리고 있습니다.','','https://www.legoland.kr/media/vgpfjkxj/screen-shot-2022-04-06-at-3-20-50-pm.png?anchor=center&mode=crop&format=webp&quality=80&width=230&height=230'),(62,3,'유모차 대여','파크 입구 근처','유모차는 파크 입구를 지나면 바로 위치하고 있는 유모차 대여소에서 유료로 대여 가능합니다. (수량 제한으로 선착순 대여) *유모차는 24개월 미만 어린이만 이용하실 수 있습니다.','대여료 : 6,000 원 보증금 : 10,000 원','https://www.legoland.kr/media/crkfnkej/stroller.jpg?anchor=center&mode=crop&format=webp&quality=80&width=230&height=230'),(63,3,'휠체어 대여','파크 입구 근처','휠체어는 파크 입구를 지나면 바로 위치하고 있는 휠체어 대여소에서 유료로 대여 가능합니다. (수량 제한으로 선착순 대여)','대여료 : 4,000 원 보증금 : 10,000 원','https://www.legoland.kr/media/geviuq0p/wheelchair.jpg?anchor=center&mode=crop&format=webp&quality=80&width=230&height=230'),(64,3,'휴대용 충전기 대여','파크 전체','휴대용 충전기는 파크 곳곳에 있는 LGU+ 휴대용 충전기 대여소에서 무료로 대여 가능합니다.','보증금:1,000원','https://www.legoland.kr/media/gjghmdeu/phone-charge.jpg?anchor=center&mode=crop&format=webp&quality=80&width=230&height=230'),(66,3,'의무실','시티 레스토랑 옆','갑자기 컨디션이 안 좋으신가요? 넘어져서 피가 난다구요? 시티 레스토랑 옆에 있는 응급처치실을 지금 바로 찾아주세요!',NULL,'https://www.legoland.kr/media/fkpiobtg/screen-shot-2022-04-06-at-3-20-42-pm.png?anchor=center&mode=crop&format=webp&quality=80&width=230&height=230'),(71,4,'물품보관함','정문 주변(파크 안 2곳, 파크 밖 6곳)','기념품과 짐 등은 물품보관함에 맡기세요.','초대형: 800엔, 특대형: 800엔, 대형: 600엔, 중형: 500엔, 소형: 400엔','https://media1.tokyodisneyresort.jp/images/adventure/service/241_map_name_1.jpg?mod=20230316144402'),(72,4,'메인스트리트 종합안내소','월드 바자','월드 바자 안에 있는 종합정보 서비스 시설입니다. 어트랙션과 공연 안내, 메시지 전달 서비스까지 무엇이든 언제든지 문의해 주십시오.','','https://media1.tokyodisneyresort.jp/images/adventure/service/211_map_name_1.jpg?mod=20230215111408'),(73,4,'미아센터','월드 바자','미아가 된 초등학생 이하의 어린이를 보호하는 시설입니다. 파크 안팎의 시설과 연락을 통해서 보호자가 어린이를 신속하게 찾을 수 있도록 도와 드립니다.','','https://media1.tokyodisneyresort.jp/images/adventure/service/181_map_name_1.jpg?mod=20230215111659'),(74,4,'티켓부스 이스트','파크 밖','도쿄디즈니랜드 정문 입구 바로 앞에 위치한 티켓부스 이스트웨스트입니다. 파크 티켓은 판매하지 않습니다. 파크 티켓은 미리 도쿄디즈니리조트 오피셜 웹사이트에서 구매해 주십시오.','','https://media1.tokyodisneyresort.jp/images/adventure/service/101_map_name_1.jpg?mod=20230328141548'),(75,4,'현금자동입출금기','월드 바자','월드 바자 안에 있으며 현금 인출과 외화 환전을 실시하고 있습니다.','','https://media1.tokyodisneyresort.jp/images/adventure/service/161_map_name_1.jpg?mod=20230301110554'),(76,6,'물품보관함','파크곳곳','물품보관함에 물건을 맡기고 보다 편하게 파크를 즐기세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon11.png'),(77,6,'미아보호소','손님상담실/알파인매표소','아이를 잃어버리신 경우 찾아드리거나 보호하고 있으니 미아보호소를 방문해 주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon8.png'),(78,6,'분실물센터','손님상담실/알파인매표소','잃어버린 물건이 있으시다면 분실물 센터를 찾아주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon10.png'),(79,6,'의무실','정문/알파인 의무실','몸이 아프시거나 이상이 있어member_id 도움이 필요하시다면 의무실을 방문해 주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon5.png'),(80,6,'자동제세동기','파크곳곳 ','응급상황 시 이용하세요',NULL,'https://e7.pngegg.com/pngimages/445/82/png-clipart-heart-automated-external-defibrillators-computer-icons-defibrillation-heart-love-child.png'),(81,6,'유모차대여소','스카이크루즈 상단 맞은편','유모차가 필요할 때 찾아주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon3.png'),(82,23,'물품보관함','파크곳곳','물품보관함에 물건을 맡기고 보다 편하게 파크를 즐기세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon11.png'),(83,23,'미아보호소','손님상담실/알파인매표소','아이를 잃어버리신 경우 찾아드리거나 보호하고 있으니 미아보호소를 방문해 주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon8.png'),(84,23,'분실물센터','손님상담실/알파인매표소','잃어버린 물건이 있으시다면 분실물 센터를 찾아주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon10.png'),(85,23,'의무실','정문/알파인 의무실','몸이 아프시거나 이상이 있어member_id 도움이 필요하시다면 의무실을 방문해 주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon5.png'),(86,23,'자동제세동기','파크곳곳 ','응급상황 시 이용하세요',NULL,'https://e7.pngegg.com/pngimages/445/82/png-clipart-heart-automated-external-defibrillators-computer-icons-defibrillation-heart-love-child.png'),(87,23,'유모차대여소','스카이크루즈 상단 맞은편','유모차가 필요할 때 찾아주세요',NULL,'https://adventure.lotteworld.com/common/images/icon/guideArea2_icon3.png'),(88,24,'물품보관함','파크곳곳','물품보관함에 물건을 맡기고 보다 편하게 파크를 즐기세요',NULL,'https://adventu